import React from 'react';
import './css/mypage.css';

const Mypage = () => {
  return (
    <div className="mypage-wrapper">
      <div className="mypage-box">
        <h2 className="mypage-title">다시 오신 걸 환영합니다</h2>

        <input type="email" placeholder="이메일 주소*" className="mypage-input" />
        <input type="password" placeholder="비밀번호*" className="mypage-input" />

        <button className="mypage-button">계속</button>

        <div className="mypage-divider">
          <span>또는</span>
        </div>

        <button className="mypage-google-button">
          <img
            src="https://www.svgrepo.com/show/475656/google-color.svg"
            alt="Google"
            className="google-icon"
          />
          Google로 계속하기
        </button>
      </div>
    </div>
  );
};

export default Mypage;
